void OAIUserApi::postUserPublicKeys(const QString &public_key, const QString &title, const ::OpenAPI::OptionalParam<qint32> &user_id) {
    QString fullPath = QString(_serverConfigs["postUserPublicKeys"][_serverIndices.value("postUserPublicKeys")].URL()+"/user/public_keys");
    
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    
    {
        input.add_var("public_key", ::OpenAPI::toStringValue(public_key));
    }
    
    {
        input.add_var("title", ::OpenAPI::toStringValue(title));
    }
    if (user_id.hasValue())
    {
        input.add_var("user_id", ::OpenAPI::toStringValue(user_id.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIUserApi::postUserPublicKeysCallback);
    connect(this, &OAIUserApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

